#include "IDrawPlugin.h"
#include "IPalette.h"
#include "FontManager.h"
#include "GfxData.h"

/////////////////////////////////////////////////////////////////////////////
// initialization and cleanup
/////////////////////////////////////////////////////////////////////////////

FontManager::FontManager(IPalette *palette, int entry)
{
	_palette = palette;
	_fontColorEntry = entry;

	_xPadding = 0;
	_yPadding = 0;

	_currentFont = 0;

	_stackPos = 0;
}

FontManager::~FontManager()
{
	for (int i = 0; i < 2; i++){
		delete _fontGfx[i];
	}
	_currentFont = 0;

	_palette = 0;
}

/////////////////////////////////////////////////////////////////////////////
// font initialization
/////////////////////////////////////////////////////////////////////////////

void FontManager::init()
{
	GfxEncoding fontGfxDesc;

	// decode all available fonts
	for (int fontNumber = 0; fontNumber < 2; fontNumber++){
		// get new font dimensions
		_fontWidth = fontDesc[fontNumber] & 0xff;
		_fontHeight = (fontDesc[fontNumber] >> 8) & 0xff;

		// fill font description to decode the font
		fontGfxDesc.sizeX = _fontWidth;		// char width
		fontGfxDesc.sizeY = _fontHeight;		// char height
		fontGfxDesc.numEntries = 256;			// 256 characters
		fontGfxDesc.bpp = 1;					// 1 bpp
		fontGfxDesc.planeOffsets[0] = 0;

		int numBytesPerLine = (_fontWidth + 7)/8;

		// x offsets
		for (int i = 0; i < _fontWidth; i++){
			fontGfxDesc.xOffs[i] = i;
		}

		// y offsets
		for (int i = 0; i < _fontHeight; i++){
			fontGfxDesc.yOffs[i] = i*8*numBytesPerLine;
		}

		// bits per char
		fontGfxDesc.entryBitSize = _fontHeight*8*numBytesPerLine;

		// decode new font
		_fontGfx[fontNumber] = GfxDecoder::decode(&fontGfxDesc, fonts[fontNumber]);
	}

	// sets the default font
	setFont(fontDesc[0]);
}

// change font
void FontManager::setFont(int size)
{
	// get new font dimensions
	_currentFont = (size >> 16) & 0xff;
	_fontWidth = size & 0xff;
	_fontHeight = (size >> 8) & 0xff;
}

/////////////////////////////////////////////////////////////////////////////
// print string functions
/////////////////////////////////////////////////////////////////////////////

// prints a string in the desired position using the current font and properties
void FontManager::print(IDrawPlugin *dp, std::string str, int x, int y)
{
	int width, height;

	// get string bounds
	measureString(str, width, height);

	// if there's space between characters, fill all the area with the background color
	if ((_xPadding != 0) || ((height > _fontHeight) && (_yPadding != 0))){
		dp->fillRect(x, y, width, height, _fontColorEntry*2);
	}

	int startX = x;

	// find out if we're clipping
	int screenWidth, screenHeight;

	const Rect *clipArea = dp->getClipArea();
	dp->getDimensions(screenWidth, screenHeight);
	bool clip = (clipArea->left != 0) || (clipArea->top != 0) || (clipArea->right != screenWidth - 1) || (clipArea->bottom != screenHeight - 1);

	// draw the string
	for (unsigned int i = 0; i < str.length(); i++){
		if (str[i] == '\n'){
			x = startX;
			y += _fontHeight + _yPadding;
		} else {
			if (!clip){
				dp->drawGfx(_fontGfx[_currentFont], str[i] & 0xff, _fontColorEntry, x, y, 0);
			} else {
				dp->drawGfxClip(_fontGfx[_currentFont], str[i] & 0xff, _fontColorEntry, x, y, 0);
			}
			x += _fontWidth + _xPadding;
		}
	}
}

// prints a string in the desired position using the current font and properties but without clearing the background
void FontManager::printTrans(IDrawPlugin *dp, std::string str, int x, int y)
{
	int startX = x;

	// find out if we're clipping
	int screenWidth, screenHeight;

	const Rect *clipArea = dp->getClipArea();
	dp->getDimensions(screenWidth, screenHeight);
	bool clip = (clipArea->left != 0) || (clipArea->top != 0) || (clipArea->right != screenWidth - 1) || (clipArea->bottom != screenHeight - 1);

	// draw the string
	for (unsigned int i = 0; i < str.length(); i++){
		if (str[i] == '\n'){
			x = startX;
			y += _fontHeight + _yPadding;
		} else {
			if (!clip){
				dp->drawGfxTrans(_fontGfx[_currentFont], str[i] & 0xff, _fontColorEntry, x, y, TRANSPARENCY_COLOR, _fontColorEntry*2);
			} else {
				dp->drawGfxClipTrans(_fontGfx[_currentFont], str[i] & 0xff, _fontColorEntry, x, y, TRANSPARENCY_COLOR, _fontColorEntry*2);
			}
			x += _fontWidth + _xPadding;
		}
	}
}

/////////////////////////////////////////////////////////////////////////////
// font colors
/////////////////////////////////////////////////////////////////////////////

void FontManager::setInkColor(UINT8 r, UINT8 g, UINT8 b)
{
	_palette->setColor(_fontColorEntry*2 + 1, r, g, b);
}

void FontManager::setBackGroundColor(UINT8 r, UINT8 g, UINT8 b)
{
	_palette->setColor(_fontColorEntry*2, r, g, b);
}

/////////////////////////////////////////////////////////////////////////////
// load/save state methods
/////////////////////////////////////////////////////////////////////////////

// saves the actual settings in the stack
void FontManager::pushSettings()
{
	assert(_stackPos < 8);

	_stack[_stackPos].currentFont = _currentFont;
	_stack[_stackPos].fontWidth = _fontWidth;
	_stack[_stackPos].fontHeight = _fontHeight;
	_stack[_stackPos].xPadding = _xPadding;
	_stack[_stackPos].yPadding = _yPadding;
	_palette->getColor(_fontColorEntry*2 + 1, _stack[_stackPos].inkColorR, _stack[_stackPos].inkColorG, _stack[_stackPos].inkColorB);
	_palette->getColor(_fontColorEntry*2, _stack[_stackPos].bgColorR, _stack[_stackPos].bgColorG, _stack[_stackPos].bgColorB);
	_stackPos++;
}

// retreives the settings from the stack
void FontManager::popSettings()
{
	assert(_stackPos > 0);

	_stackPos--;
	_currentFont = _stack[_stackPos].currentFont;
	_fontWidth = _stack[_stackPos].fontWidth;
	_fontHeight = _stack[_stackPos].fontHeight;
	_xPadding = _stack[_stackPos].xPadding;
	_yPadding = _stack[_stackPos].yPadding;
	_palette->setColor(_fontColorEntry*2 + 1, _stack[_stackPos].inkColorR, _stack[_stackPos].inkColorG, _stack[_stackPos].inkColorB);
	_palette->setColor(_fontColorEntry*2, _stack[_stackPos].bgColorR, _stack[_stackPos].bgColorG, _stack[_stackPos].bgColorB);
}


/////////////////////////////////////////////////////////////////////////////
// helper methods
/////////////////////////////////////////////////////////////////////////////

// gets string width and height
void FontManager::measureString(std::string str, int &width, int &height)
{
	int lines = 1;
	int actualLineWidth = 0;
	width = 0;

	// scan the string to find out how many lines does it take and the maxium width
	for (unsigned int i = 0; i < str.length(); i++){
		if (str[i] == '\n'){
			lines++;
			actualLineWidth = 0;
		} else {
			actualLineWidth += _fontWidth;
			if (actualLineWidth > width){
				width = actualLineWidth;
			}
			actualLineWidth += _xPadding;
		}
	}

	height = (_fontHeight + _yPadding)*(lines - 1) + _fontHeight;
}

